import React,{ Component } from 'react';
import {
   HeaderWrapper,
   Logo,
   
} from './style';

class Header extends Component{
    render(){
        return <HeaderWrapper>
            <Logo href='/'></Logo>
        </HeaderWrapper>
    }
}

export default Header;
